  return (
    <header>
      <nav className="nav">
      <img src={logo} className="App-logo" alt="logo" />        <ul className="nav-items">
          <li>Pricing</li>
          <li>About</li>
          <li>Contact Us</li>
        </ul>
      </nav>
    </header>
  );
}
